import React from "react";

const Home = () => {
  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gradient-to-br from-gray-900 via-black to-gray-800 text-center px-6 font-sans">
      {/* Heading */}
      <h1 className="text-4xl md:text-5xl font-bold text-white mb-4 tracking-tight">
        Welcome to{" "}
        <span className="text-indigo-400">GitMind</span>
      </h1>

      {/* Subheading */}
      <p className="text-lg text-gray-400 mb-8">
        Click below to continue with GitHub
      </p>

      {/* GitHub Login Button */}
      <a href="http://localhost:5000/auth/github">
        <button className="px-8 py-3 text-lg font-medium rounded-xl bg-indigo-600 text-white shadow-md hover:bg-indigo-700 hover:shadow-lg transition duration-300">
          Login with GitHub
        </button>
      </a>
    </div>
  );
};

export default Home;
